import React, { useEffect, useState } from "react";
import './App.css';

const App = () => {
    const API_URL = `http://aleksanderblaszkiewicz.pl/callendar/get_events.php`;
    const [events, setEvents] = useState([]);

    useEffect(() => {
        fetch(API_URL).then((response) => response.json()).then((data) => setEvents(data).then(() => console.log(events)));
    }, []);

    return  (
        <>
            <div className="App">
                <h1>Kalendarz</h1>
            </div>
        </>
    )
}

export default App;
